import Event from './event';

export const EVENTS: Event[] = [
    {
        id: 1,
        name: "80s",
        picture: "",
        types: ["vin", "80s"],
        date: new Date(),
        nombre_de_personnes: 100, // Ajoutez la valeur pour le nombre de personnes
        lieu: "Lieu de l'événement", // Ajoutez la valeur pour le lieu
        objectif_de_l_evenement: "Objectif de l'événement" // Ajoutez la valeur pour l'objectif de l'événement
    },
];
